    return (1-t)*start + t*end;

    }

    return amount;
}

function recalculateGroupedDonations() {
    groupedDonations = [];
    groupMaxAmount = 0;
    var msPerPixel = (endTime - startTime) / canvas.width;
    var minTimespan = msPerPixel * 100;

    var groupStart = -1;
    var groupEnd = 0;
    var groupAmount = 0;
    var groupCount = 0;
    for (var i = 0; i < donations.length; ++i) {
        if (donations[i][0] < minTime || donations[i][0] > maxTime) {
            continue;
        }
        if (groupStart == -1) {
            groupStart = donations[i][0];
        }
        groupEnd = donations[i][0];
        if ((groupEnd - groupStart) > minTimespan) {
            groupMaxAmount = Math.max(groupAmount, groupMaxAmount);
            groupedDonations.push([groupStart, groupEnd, groupAmount, groupCount]);
            groupStart = donations[i][0];
            groupAmount = 0;
            groupCount = 0;
        }
        groupAmount += donations[i][1];
        groupCount++;
    }

    if ((groupEnd - groupStart) > minTimespan) {
        groupMaxAmount = Math.max(groupAmount, groupMaxAmount);
        groupedDonations.push([groupStart, groupEnd, groupAmount, groupCount]);
    } else {
        var last = groupedDonations[groupedDonations.length-1];
        last[1] = groupEnd;
        last[2] += groupAmount;
        last[3] += groupCount;
        groupMaxAmount = Math.max(last[2], groupMaxAmount);
    }

    dirty = true;
}

function panTime(moveAmount) {
    if (moveAmount > 0) {
        var targetStartTime = Math.max(minTime, startTime - moveAmount);
        endTime += targetStartTime - startTime;
        startTime = targetStartTime;
    } else {
        var targetEndTime = Math.min(maxTime, endTime - moveAmount);
        startTime += targetEndTime - endTime;
        endTime = targetEndTime;
    }
    updateCanvasRelativeAmounts();
    dirty = true;
}

function updateCanvasRelativeAmounts() {
    var amount = 0;
    var hitStart = false;
    var hitEnd = false;
    for (var i = 0; i < donations.length && !(hitStart && hitEnd); ++i) {
        if (0) {
            if (!hitStart && donations[i][0] > startTime) {
                hitStart = true;
                startAmount = lerp(amount, amount + donations[i][1], (startTime - donations[i-1][0]) / (donations[i][0] - donations[i-1][0]));
            }
            if (!hitEnd && donations[i][0] > endTime) {
                hitEnd = true;
                endAmount = lerp(amount, amount + donations[i][1], (endTime - donations[i-1][0]) / (donations[i][0] - donations[i-1][0]));
            }
        } else {
            if (!hitStart && donations[i][0] >= startTime) {
                hitStart = true;
                startAmount = (donations[i][0] == startTime) ? amount + donations[i][1] : amount;
            }
            if (!hitEnd && donations[i][0] >= endTime) {

        }
        amount += donations[i][1];
    }

    if (!hitEnd) {

    }
}

canvas.addEventListener("wheel", function(ev) {
    var amount = ev.deltaY;
    var minTimeSpan = 60000;
    switch (ev.deltaMode) {
        case 0: // pixel
            amount *= 0.001;
            break;
        case 1: // line
            amount *= 0.1;
            break;
        case 2: // page
            amount *= 0.1;
            break;
    }
    if (amount > 0 || (endTime - startTime) > minTimeSpan) {
        var timeDelta = (endTime - startTime) * amount;
        var mousePos = ev.offsetX / canvas.width;
        startTime -= timeDelta * mousePos;
        startTime = Math.max(minTime, startTime);
        endTime += timeDelta * (1-mousePos);
        endTime = Math.min(maxTime, endTime);
        if (endTime <= startTime || endTime - startTime < minTimeSpan) {
            endTime = Math.min(maxTime, startTime + minTimeSpan);
        }
        if (endTime <= startTime || endTime - startTime < minTimeSpan) {
            startTime = Math.max(minTime, endTime - minTimeSpan);
        }

        updateCanvasRelativeAmounts();
        recalculateGroupedDonations();
        dirty = true;

function toMoney(number) {
    var str = number.toFixed(2);
    if (str.length > "000.00".length) {
        str = str.slice(0, str.indexOf(".") - 3) + "," + str.slice(str.indexOf(".") - 3);
    }

    if (str.length > "000,000.00".length) {
        str = str.slice(0, str.indexOf(",") - 3) + "," + str.slice(str.indexOf(",") - 3);
    }
    return "$" + str;
}

function timestampToCanvas(timestamp) {
    return (timestamp - startTime) / (endTime - startTime) * canvas.width;
}

function amountToCanvas(amount) {
    if (absoluteAmount) {
        return graphBottom - amount / totalRaised * graphBottom;
    } else {
        return graphBottom - (amount - startAmount) / (endAmount - startAmount) * graphBottom;
    }
}

function drawCanvas() {
    var msPerPixel = (endTime - startTime) / canvas.width;
    var mouseTime = startTime + msPerPixel * mouseHoverX;

    // Clear
    ctx.fillStyle = "#000010";
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    // Title
    ctx.fillStyle = "#202047";
    ctx.textAlign = "left";
    ctx.textBaseline = "top";
    ctx.font = "50px sans-serif";
    ctx.fillText("Summer Games Done Quick 2017 statistics", 10, 10);
    ctx.font = "30px sans-serif";
    ctx.fillText("Total money raised: " + toMoney(totalRaised) + " (" + donations.length + " donations)", 10, 60);
    ctx.font = "20px sans-serif";
    ctx.fillText("Absolute amount (Z): " + (absoluteAmount ? "On" : "Off"), 10, 120);

    // Grouped donations
    for (var i = 0; i < groupedDonations.length; ++i) {
        if (groupedDonations[i][1] < startTime) {
            continue;
        }
        if (groupedDonations[i][0] > endTime) {
            break;
        }
        var group = groupedDonations[i];
        ctx.fillStyle = "green";
        var groupTop = graphBottom - (group[2] / groupMaxAmount) * graphBottom;
        var groupStartX = timestampToCanvas(group[0]);
        var groupEndX = timestampToCanvas(group[1]);
        ctx.fillRect(groupStartX, groupTop, groupEndX - groupStartX, graphBottom - groupTop);

        ctx.font = "15px sans-serif";
        ctx.textAlign = "center";
        ctx.textBaseline = "middle";
        ctx.fillStyle = "white";
        var textTop = Math.min(groupTop + 20, graphBottom - 40);
        ctx.fillText(toMoney(group[2]), (groupStartX + groupEndX) / 2, textTop);
        ctx.font = "10px sans-serif";
        ctx.fillText(group[3] + " donations", (groupStartX + groupEndX) / 2, textTop + 20);
    }

    // Total donations line graph
    var firstDonationIdx = 0;
    for (var i = 0; i < donations.length; ++i) {
        if (donations[i][0] >= startTime) {
            firstDonationIdx = (i == 0 || donations[i][0] == startTime) ? i : i-1;
            break;
        }
    }

    var donationIdx = firstDonationIdx;
    var totalAmount = getTotalAmountAtTimestamp(donations[donationIdx][0]);
    ctx.moveTo(0, amountToCanvas(totalAmount));
    for (var i = 0; i < canvas.width; ++i) {
        var currentTime = i * (endTime-startTime) / canvas.width + startTime;
        var prevIdx = donationIdx;
        var additionalAmount = 0;
        while (donationIdx < donations.length-1 && donations[donationIdx][0] < currentTime) {
            donationIdx++;
            additionalAmount += donations[donationIdx][1];
        }
        if (prevIdx != donationIdx) {
            if (donations[donationIdx][0] > currentTime) {
                additionalAmount -= donations[donationIdx][1];
                donationIdx--;
            }
        }
        if (prevIdx != donationIdx) {
            ctx.lineTo(i, amountToCanvas(totalAmount));
            totalAmount += additionalAmount;
            ctx.lineTo(i, amountToCanvas(totalAmount));
        }
    }
    ctx.lineTo(canvas.width, amountToCanvas(totalAmount));
    ctx.strokeStyle = "wheat";
    ctx.lineWidth = 4;
    ctx.stroke();
    ctx.lineTo(canvas.width, graphBottom);
    ctx.lineTo(0, graphBottom);
    ctx.closePath();
    ctx.fillStyle = "#404080";
    ctx.globalAlpha = 0.7;
    ctx.fill();
    ctx.globalAlpha = 1;

    // Total donated at mouse cursor
    var mouseX = timestampToCanvas(mouseTime);
    var mouseAmount = getTotalAmountAtTimestamp(mouseTime);
    var mouseY = amountToCanvas(mouseAmount);
    if (mouseHoverY < graphBottom && mouseHoverY >= mouseY) { // if (mouseHoverY < graphBottom) {
        ctx.beginPath();
        ctx.arc(mouseX, mouseY, 5, 0, Math.PI * 2);
        ctx.fillStyle = "white";
        ctx.fill();

        ctx.font = "15px sans-serif";
        ctx.textAlign = "left";
        ctx.textBaseline = "middle";
        var text = toMoney(mouseAmount)
        var textWidth = ctx.measureText(text).width;
        var textX = Math.min(mouseX + 5, canvas.width - 5 - textWidth);
        var textY = Math.max(mouseY - 10, 10);
        ctx.fillText(text, textX, textY);
    }


    // Runs
    var timeT = (endTime-startTime)/(maxTime-minTime);
    timeT = 1-timeT;
    timeT *= timeT;
    timeT *= timeT;
    timeT *= timeT;
    timeT *= timeT;
    timeT *= timeT;
    timeT = 1-timeT;
    ctx.lineWidth = Math.max(0.1, 5 - timeT * 5);
    var donationIdx = 0;
    var totalAmount = 0;
    var runColors = ["#300030", "#303000"];
    for (var i = 0; i < runs.length; ++i) {
        var run = runs[i];

        // Run dividers
        ctx.strokeStyle = "#aabbaa";
        ctx.lineWidth = (highlightRuns ? 2 : 0.1);
        if (highlightRuns && run.start < mouseTime && mouseTime < run.end) {
            if (run.start >= startTime && run.start <= endTime) {
                ctx.beginPath();
                ctx.moveTo(timestampToCanvas(run.start), 0);
                ctx.lineTo(timestampToCanvas(run.start), graphBottom);
                ctx.stroke();
            }
            if (run.end >= startTime && run.end <= endTime) {
                ctx.beginPath();
                ctx.moveTo(timestampToCanvas(run.end), 0);
                ctx.lineTo(timestampToCanvas(run.end), graphBottom);
                ctx.stroke();
            }
        }

        ctx.fillStyle = runColors[i % runColors.length];
        ctx.fillRect(timestampToCanvas(run.start), graphBottom, timestampToCanvas(run.end) - timestampToCanvas(run.start), runsBottom - graphBottom);

        if (!(run.end < startTime || run.start > endTime)) {

            // Run details
            var runWidth = (run.end - run.start) / msPerPixel;
            if (runWidth > 150) {
                var startX = Math.max(0, timestampToCanvas(run.start));
                var endX = Math.min(canvas.width, timestampToCanvas(run.end));
                var midX = (startX + endX) / 2;

                // Amount raised per run
                var amountRaised = 0;
                while (donationIdx < donations.length && donations[donationIdx][0] < run.start) {
                    totalAmount += donations[donationIdx][1];
                    donationIdx++;
                }
                var startingAmount = totalAmount;
                var startingIdx = donationIdx;
                while (donationIdx < donations.length && donations[donationIdx][0] < run.end) {
                    totalAmount += donations[donationIdx][1];
                    donationIdx++;
                }
                amountRaised = totalAmount - startingAmount;
                var numDonations = donationIdx - startingIdx - 1;
                ctx.font = "18px sans-serif";
                ctx.textAlign = "center";
                ctx.textBaseline = "middle";
                ctx.fillStyle = "#aaaaaa";
                var amountRaisedWidth = ctx.measureText(toMoney(amountRaised)).width;
                var amountRaisedX = (midX < canvas.width/2) ? Math.min(midX, endX - 10 - amountRaisedWidth/2) : Math.max(midX, startX + 10 + amountRaisedWidth/2);
                // ctx.fillText(toMoney(amountRaised), amountRaisedX, graphBottom - 25);
                ctx.font = "10px sans-serif";
                // ctx.fillText(numDonations + " donations", amountRaisedX, graphBottom - 10);

                ctx.font = "20px sans-serif";
                var name = run.name;
                while (ctx.measureText(name).width > runWidth - 20) {
                    name = name.slice(0, -4).trim() + "...";
                }
                ctx.fillStyle = "#cccccc";
                var detailsWidth = ctx.measureText(name).width;
                var detailsX = (midX < canvas.width/2) ? Math.min(midX, endX - 10 - detailsWidth/2) : Math.max(midX, startX + 10 + detailsWidth/2);
                ctx.fillText(name, detailsX, graphBottom + 30);

                var runDuration = run.end - run.start;
                var runDurationText = padTime(Math.floor(runDuration/1000/60/60)) + ":" + padTime(Math.floor(runDuration/1000/60) % 60) + ":" + padTime(Math.floor(runDuration/1000) % 60);
                ctx.font = "10px sans-serif";
                ctx.fillText(runDurationText, detailsX, graphBottom + 10);

                ctx.fillStyle = "#808080";
                var at = 53;
                if (run.runners.length == 1) {
                    var name = run.runners[0];
                    while (ctx.measureText(name).width > runWidth - 20) {
                        name = name.slice(0, -4).trim() + "...";
                    }
                    ctx.font = "18px sans-serif";
                    ctx.fillText(name, detailsX, graphBottom + at);
                    at += 23;
                } else {
                    for (var runnerIdx = 0; runnerIdx < run.runners.length; ++runnerIdx) {
                        var name = run.runners[runnerIdx];
                        while (ctx.measureText(name).width > runWidth - 20) {
                            name = name.slice(0, -4).trim() + "...";
                        }
                        ctx.font = "15px sans-serif";
                        ctx.fillText(name, detailsX, graphBottom + at);
                        at += 18;
                    }
                }
            } else if (runWidth > 15) {
                var startX = timestampToCanvas(run.start);
                var endX = timestampToCanvas(run.end);
                var midX = (startX + endX) / 2;
                ctx.fillStyle = "#cccccc";
                ctx.textAlign = "center";
                ctx.textBaseline = "middle";
                ctx.font = "10px sans-serif";
                var name = run.name;
                while (ctx.measureText(name).width > runsBottom - graphBottom - 20) {
                    name = name.slice(0, -4).trim() + "...";
                }
                ctx.save();
                ctx.translate(midX, (runsBottom + graphBottom) / 2);
                ctx.rotate(-Math.PI/2);
                ctx.fillText(name, 0, 0);
                ctx.restore();
            }
        }
    }

    // Timeline
    var startDate = new Date(startTime);
    var startDateTimestamp = startDate.setHours(0, 0, 0, 0);
    var msPerDay = 1000 * 60 * 60 * 24;
    var colors = ["#804040", "#408040"];
    var colorIdx = startDate.getDate() % 2;
    var currentTime = startDateTimestamp;
    var dayDivisionSteps = [0, 1, 2, 4, 12, 24, 24*2, 24*4, 24*6, 24*12, 24*60, 24*60*2, 24*60*6];
    var dayDivision = dayDivisionSteps[0];
    for (var i = 0; i < dayDivisionSteps.length; ++i) {
        var msPerDivision = msPerDay / dayDivisionSteps[i];
        var msPerPixel = (endTime - startTime) / canvas.width;
        var pixelsPerDivision = msPerDivision / msPerPixel;
        if (pixelsPerDivision > 100) {
            dayDivision = dayDivisionSteps[i];
        } else {
            break;
        }
    }
    while (currentTime < endTime) {
        var dayStart = Math.max(startTime, currentTime);
        var dayEnd = Math.min(endTime, currentTime+msPerDay);
        var startX = timestampToCanvas(dayStart);
        var endX = timestampToCanvas(dayEnd);
        ctx.fillStyle = colors[colorIdx];
        colorIdx = (colorIdx + 1) % 2;
        ctx.fillRect(startX, runsBottom, endX - startX, timelineBottom - runsBottom);

        ctx.textAlign = "center";
        ctx.textBaseline = "middle";
        ctx.fillStyle = "white";
        ctx.font = "15px sans-serif";
        var text = new Date(currentTime).toDateString();
        var textWidth = ctx.measureText(text).width;
        var midX = (startX + endX) / 2;
        var textX = (midX < canvas.width / 2) ? Math.min(midX, endX - 10 - textWidth/2) : Math.max(startX + 10 + textWidth/2, midX);
        ctx.fillText(text, textX, timelineBottom - 10);

        ctx.font = "10px sans-serif";
        var msPerDivision = msPerDay / dayDivision;
        var divStart = Math.floor((dayStart - currentTime) / msPerDivision);
        var divEnd = Math.ceil((dayEnd - currentTime) / msPerDivision);
        for (var i = divStart; i < divEnd; ++i) {
            var timeMarker = currentTime + msPerDivision * i;
            var markerX = timestampToCanvas(timeMarker);
            ctx.beginPath();
            ctx.moveTo(markerX, runsBottom + 15);
            ctx.lineTo(markerX, (highlightTimeline ? 0 : runsBottom - 15));
            ctx.strokeStyle = "white";
            ctx.lineWidth = (highlightTimeline ? 2 : 1);
            ctx.stroke();
            ctx.fillText(new Date(timeMarker).toLocaleTimeString(), timestampToCanvas(timeMarker), runsBottom + 23);
        }

        currentTime += msPerDay;
    }

    // Big separators
    ctx.beginPath();
    ctx.moveTo(0, graphBottom);
    ctx.lineTo(canvas.width, graphBottom);
    ctx.strokeStyle = "#ffffff";
    ctx.lineWidth = 5;
    ctx.stroke();

    ctx.beginPath();
    ctx.moveTo(0, runsBottom);
    ctx.lineTo(canvas.width, runsBottom);
    ctx.strokeStyle = "#ffffff";
    ctx.lineWidth = 5;
    ctx.stroke();


}

function update() {
    if (scrollDir != 0) {
        msPerPixel = (endTime - startTime) / canvas.width;
        panTime(msPerPixel * scrollDir);
    }
    if (dirty) {
        drawCanvas();
        dirty = false;
    }

    requestAnimationFrame(update);
}

update();


</script>
</body>
</The Aristocrats!>
